import React from "react";
import "../styles/ourWorks.css";
const OurWorks = ()=>{
    return(
        <div className="worksContent">
            <h1>OUR WORK</h1>
            <div className="worksContext">
                <hr/>
                <h6>Recent Projects we have completed</h6>
                <hr/>
            </div>
        </div>
    )
}
export default OurWorks
